INSERT OR REPLACE INTO Pelicula (id_pelicula, titulo, descripcion, poster_path, backdrop_path, trailer, anio_estreno, duracion) VALUES (1272837, '28 años después: El templo de los huesos', 'El Dr. Kelson (Ralph Fiennes) se ve envuelto en una nueva y sorprendente relación, cuyas consecuencias podrían cambiar el mundo tal y como se conoce. Por otra parte, el encuentro de Spike (Alfie Williams) con el Gran Lord Jimmy Crystal (Jack O''Connell) se convierte en una pesadilla de la que el chico no puede escapar. En este mundo, los infectados ya no son la mayor amenaza para la supervivencia, ya que la inhumanidad de los supervivientes puede ser aún más extraña y aterradora.', 'https://image.tmdb.org/t/p/original/9qlqDX3lo7CiFCDZV1Qwopwm5rz.jpg', 'https://image.tmdb.org/t/p/original/cwX1koqx0UsN0naDGxKFMs3raUZ.jpg', 'https://www.youtube.com/watch?v=RcnPIyUI53Q', 2026, 109);
