INSERT OR REPLACE INTO Pelicula (id_pelicula, titulo, descripcion, poster_path, backdrop_path, trailer, anio_estreno, duracion) VALUES (1439112, 'En busca de venganza 2: Ciudad de los lobos', 'Jake Rosser está atormentado por el trastorno de estrés postraumático de sus días como oficial K-9 y se esfuerza por llevar una vida pacífica con su familia y su compañero K-9 retirado, Socks. Pero la tranquilidad se disuelve rápidamente cuando una despiadada banda los persigue en un brutal ataque. Decidido a proteger a sus seres queridos, Jake y su nuevo compañero K-9 «Argos» se adentran en los violentos entresijos de la delincuencia, donde Jake se enfrenta a funcionarios corruptos, descubre una peligrosa red de tráfico de drogas y lucha contra sus propios demonios internos.', 'https://image.tmdb.org/t/p/original/yBg2t8vuqrE8nqrxS3VzW3Qvzh3.jpg', 'https://image.tmdb.org/t/p/original/ncI1PlBcANixIkgQSnjsSRz4OyT.jpg', '', 2025, 93);
